window.bookSummaryJSON = "<p><b>After a much longed-for reunion, Jason Asano works on moving past old traumas as he looks to a brighter future.</b></p> <p>Despite warnings of danger that awaits him, he gets back in the saddle as an adventurer, ready to tackle new challenges.</p> <p>But as enemies that have lurked in the background start moving into the light, those challenges are not hard to find.</p> <p>Jason and his friends donâ€™t wait passively; they use schemes of their own to take the fight to the enemy. His companions find themselves plunged into dangerous missions and confronted with enemies both personal and unexpected.</p> <p>Jason will push new boundaries, and while it comes at a cost, it will move him deeper into the realms of cosmic power.</p>"; 
